class DataFilter{constructor(a){this.arrayOfObject=a.data,this.valueToSearch=a.value,this.searchParameter=null!=a.searchparam?a.searchParameter:"all"}Search(){var a=[];const r=Object.keys(this.arrayOfObject[0]);if("all"==this.searchParameter)this.arrayOfObject.forEach(e=>{r.forEach(r=>{e[r].toString().includes(this.valueToSearch)&&(a.includes(e)||a.push(e))})});else{const r=this.searchParameter;this.arrayOfObject.forEach(e=>{e[r].toString().includes(this.valueToSearch)&&(a.includes(e)||a.push(e))})}return a}}